import React from 'react'
import frontImag from "../Assets/frontImg.png"
import "@coreui/coreui/dist/css/coreui.min.css";
import {
    CButton
  } from "@coreui/react";
const HomePage = () => {
  return (
    <>
<div className="imageSide">

    <img src={frontImag} alt="This is main image" srcset="" width="800vw" height="500vh"/>

</div>
    Microsoft Teams
   Meet chat and collaborate in one place
  <CButton color="primary" type="submit">Sign in</CButton>
  <CButton color="light" type="submit">Sign Up</CButton>
    </>
  )
}

export default HomePage
